import React from "react";
import "../styles/slideshow.css"

function Slideshow() {
    return <div>
        <img className="slideshow-img" src="https://www.epn.edu.ec/wp-content/uploads/2010/09/DSC00179.jpg" alt="EPN"/>
        
        <a className="prev" >&#10094;</a>
        <a className="next" >&#10095;</a>
        <a className="slideshow-circles">○⬤○○</a></div>

}

export default Slideshow;
